import brandlogo from './brand.svg';
import {
  FormControl,
  Button,
  FormGroup,
  Navbar,
  NavItem,
  Container,
  Image,
  ButtonGroup,
  ToggleButtonGroup,
  ToggleButton,ButtonToolbar,
  Nav,
  Form,
} from "react-bootstrap";
import * as FaIcons from 'react-icons/fa';

import 'bootstrap/dist/css/bootstrap.css';
//import classes from "./NavigBar.module.css";
import './NavigBar.css'
function NavigBar() {
  return (
    <div>
       <Navbar bg='light'>

           <Nav >
             <FaIcons.FaBars/>
         </Nav>
         <Nav id='space'>
             <Navbar.Brand>
           <  img width="146px" height="24px" className="img-responsive" src={brandlogo}  alt="logo" />
             </Navbar.Brand>
         </Nav>
         <Nav>
             <div id="groupBtn" className='rounded-pill' >
             <ToggleButtonGroup type='radio' name='options'>
           <Button  className='rounded-pill' name='op1'>Delivery</Button>
           <Button  className='rounded-pill' name='op2'>Pickup</Button>

           </ToggleButtonGroup>
             </div>


         </Nav>






       </Navbar>
    </div>
  );
}
export default NavigBar;
